import React from 'react';
import { Stethoscope, Users, Clock } from 'lucide-react';

const ClinicLanding = () => {
  return (
    <div className="min-h-screen bg-gray-50">
      {/* Hero Section with Background */}
      <div className="relative h-[400px] overflow-hidden">
        <div 
          className="absolute inset-0 bg-cover bg-center"
          style={{
            backgroundImage: 'url("https://images.unsplash.com/photo-1580281657529-8c42f9db21ba")',
            backgroundPosition: 'center 30%'
          }}
        >
          <div className="absolute inset-0 bg-black/50" />
        </div>
        <div className="relative container mx-auto px-6 pt-20 text-center">
          <h2 className="text-2xl font-semibold text-white bg-black/30 px-4 py-2 rounded-lg inline-block shadow-lg">
            Your Health, Our Priority â€“ The Ultimate Clinic Management Solution!
          </h2>
        </div>
      </div>
              
      {/* Stats Cards */}
      <div className="container mx-auto px-6 py-10">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6 text-center">
          <div className="p-6 bg-white rounded-lg shadow">
            <Stethoscope className="mx-auto text-blue-600" size={40} />
            <h2 className="text-3xl font-bold mt-4">20+</h2>
            <p className="text-gray-600">Medical Specialists</p>
          </div>

          <div className="p-6 bg-white rounded-lg shadow">
            <Users className="mx-auto text-blue-600" size={40} />
            <h2 className="text-3xl font-bold mt-4">15k+</h2>
            <p className="text-gray-600">Satisfied Patients</p>
          </div>

          <div className="p-6 bg-white rounded-lg shadow">
            <Clock className="mx-auto text-blue-600" size={40} />
            <h2 className="text-3xl font-bold mt-4">24/7</h2>
            <p className="text-gray-600">Medical Support</p>
          </div>
        </div>
      </div>

    </div>
  );
};

export default ClinicLanding;
